// ==UserScript==
// @name         Steam - Show Linux compatibility up top
// @namespace    http://tampermonkey.net/
// @version      0.3
// @description  Shows Linux compatibility in a game page's title so you can see at a glance whether it supports linux without having to scroll down.
// @author       You
// @match        https://store.steampowered.com/app/*
// @grant        none
// ==/UserScript==

if(!document.querySelector('.platform_img.linux')) return

const iconImage = document.createElement('img')
iconImage.setAttribute('style', `
  position: relative;
  float: right;
  margin-right: 10px;
  height: 30px;

`)
iconImage.setAttribute('src', 'data:image/png;base64,')
document.querySelector('.apphub_HeaderStandardTop').insertBefore(iconImage, document.querySelector('.apphub_AppName'))